import React from 'react';
import { useLocation } from 'react-router-dom';
import '../../CSS/CollaborativeRoom.css'; // Import your CSS file for styling


const Collaborative = () => {
    const location = useLocation();
    const { project } = location.state || {}; // Access the passed project from state
    const { id } = "dummy"

    return (
        <div className="collaborative-container">
            <div className="project-box">
                {project ? `Collaborate to project: ${project}` : 'No Project'}
            </div>
            <div className="id-box">
                {project ? `ID: ${id}` : 'No id'}
            </div>
        </div>
    );
};

export default Collaborative;
